import React from "react"
import styled from "@emotion/styled"

const navItem = (props) => {
  let item = props.item
  const NavItem = styled.li`
    padding: 0 0.5rem;
  `
  const NavItemI = styled.a`
    color: white;
    text-decoration: none;
    &: hover {
      color: orange;
    }
    &: active {
      color: orange;
    } ;
  `

  let reference = `${item.reference}`
  let name = `${item.name}`
  return (
    <NavItem>
      <NavItemI href={reference}>{name}</NavItemI>
    </NavItem>
  )
}

export default navItem
